import React from 'react';
import classes from './Dialogs.module.css';
import { NavLink } from 'react-router-dom';


const Dialogs = (props) => {
return(
    <div className={classes.dialogs}>
        <div className={classes.dialogs.item}>
<div><NavLink className={classes.item} to='/dialogs/1'>User 1</NavLink></div>
<div><NavLink to='/dialogs/2'>User 2</NavLink></div>
<div><NavLink to='/dialogs/3'>User 3</NavLink></div>
<div><NavLink to='/dialogs/4'>User 4</NavLink></div>
<div><NavLink to='/dialogs/5'>User 5</NavLink></div>
        </div>
  <div>Hi</div>
    </div>

)
}

export default Dialogs;
